import React, { Component } from "react";
import { GreenButton } from "../GreenButton/GreenButton";
import styles from "./ReceivedItemModal.module.scss";

export default class ReceivedItemModal extends Component {
  constructor(props) {
    super(props);
    switch (this.props.type) {
      case 1:
        this.state = {
          imageWrapBgClass: styles.imageWrap_blue
        };
        break;
      case 2:
        this.state = {
          imageWrapBgClass: styles.imageWrap_purple
        };
        break;
      case 3:
        this.state = {
          imageWrapBgClass: styles.imageWrap_pink
        };
        break;
      case 4:
        this.state = {
          imageWrapBgClass: styles.imageWrap_red
        };
        break;
      case 5:
        this.state = {
          imageWrapBgClass: styles.imageWrap_special
        };
        break;
      case 6:
        this.state = {
          imageWrapBgClass: styles.imageWrap_consumerGrade
        };

      default:
        break;
    }
  }

  render() {
    return (
      <div
        style={{ backgroundImage: "/images/linedbg.jpg" }}
        className={styles.receivedItemModal}
      >
        <h1 className={styles.itemTitle}>{this.props.title}</h1>
        <div className={`${styles.imageWrap} ${this.state.imageWrapBgClass}`}>
          <img src={this.props.image} alt='' />
        </div>
        <div className={styles.bottomWrap}>
          <span>You got a new item!</span>
          <GreenButton
            onClick={() => {
              this.props.onSubmit();
            }}
            text={"Continue"}
          />
        </div>
      </div>
    );
  }
}
